css:
.aec-icon {
  font-style: normal;
  font-weight: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  content: '\0041';
  font-family: 'EditorConfig';
}
.reset-style {
  font-style: normal;
  font-weight: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}
@font-face {
  font-style: normal;
  font-weight: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  font-family: 'EditorConfig';
  src: url('atom://editorconfig/fonts/AtomEditorconfig-Regular.woff') format('woff');
}
.aec-icon-mouse,
.aec-icon-mouse:before {
  font-style: normal;
  font-weight: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  content: '\0041';
  font-family: 'EditorConfig';
}
.aec-status-report.icon::before {
  font-style: normal;
  font-weight: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
  content: '\0041';
  font-family: 'EditorConfig';
  font-size: 20px;
  line-height: 1;
}
.aec-status-report .message.item .aec-filename {
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  display: inline-block;
  vertical-align: bottom;
  max-width: calc(99%);
  font-weight: bold;
}
.aec-status-report .message.item .aec-filename::after {
  content: ":";
  font-weight: normal;
}
.aec-status-report .description h3 {
  margin-top: 0;
}
.aec-status-report .description ol {
  padding-left: 1em;
}
.aec-status-report .description li {
  margin-bottom: 1em;
}
.aec-status-report .description #active-configuration {
  margin-top: 1em;
  border-top: 1px solid;
  padding-top: 1em;
}
.aec-status-report .description table {
  min-width: 60%;
}
.aec-status-report.success .message.item .aec-filename::after {
  content: "!";
}
.aec-status-report.success .description ol {
  padding-left: 0;
}
.aec-status-report.success .description ol > li {
  margin-left: 1em;
}
.aec-status-report.success .description ol > li:only-child {
  list-style: none;
  padding-left: 0;
  margin-left: 0;
}
